import React from 'react';

const caseStudies = [
  { title: "Case Study 1", file: "/pdfs/casestudy1.pdf" },
  { title: "Case Study 2", file: "/pdfs/casestudy2.pdf" },
  // Add more as needed
];

const CaseStudiesList = () => (
  <section className="page case-list">
    <h2>Case Studies</h2>
    <div className="pdf-grid">
      {caseStudies.map((item, idx) => (
        <div className="pdf-card" key={idx}>
          <span>{item.title}</span>
          <a href={item.file} target="_blank" rel="noopener noreferrer">View PDF</a>
        </div>
      ))}
    </div>
  </section>
);

export default CaseStudiesList;
